import { userDataAction } from "./action";
import { ActionTypes } from "./constants";

const initialData={
    Data:{}
}

export const userDataReducer=(state=initialData.Data,action)=>{
switch(action.type){
    case ActionTypes.userData:
        return [...state,action.payload]
    default:
        return state
}
}
